  CONSTRAINT `Projects_ibfk_1` FOREIGN KEY (`userId`) REFERENCES `Users` (`id`),
  CONSTRAINT `Projects_ibfk_2` FOREIGN KEY (`tagId`) REFERENCES `Tags` (`id`),
  CONSTRAINT `Projects_ibfk_3` FOREIGN KEY (`tag2Id`) REFERENCES `Tags` (`id`),
