INSERT INTO `Projects` (`id`, `title`, `description`, `shortDescription`, `vote`, `image`, `shortImage`, `github_link`, `project_link`, `userId`, `tagId`, `tag2Id`, `tag3Id`, `tag4Id`, `tag5Id`, `tag6Id`, `createdAt`, `updatedAt`) VALUES
('5', 'DeviensDev le site pour découvrir les métiers du développement', '<h1>DeviensDev le site pour découvrir les métiers du développement&nbsp;</h1><p><br></p><p>Deviens.dev est un projet open-source mijoté par l\\\'école O\\\'Clock !</p><p><br></p><p>Créé par des développeurs,&nbsp;<strong>DeviensDev</strong>&nbsp;vous ouvre les portes du développement web en mettant à votre disposition toutes les clés pour comprendre le métier de développeur, vous initier au code et vous orienter vers les formations adéquates.</p><p><br></p><p>La vocation commence par l’information. Le métier de développeur étant complexe, il est nécessaire de se documenter avant de s’y orienter. Pour ce faire, nous avons mis des fiches pratiques sur les compétences et prérequis à réunir, les différentes spécialisations et les débouchés que vous pouvez découvrir ici :</p><p><br></p><p><a href=\\\"https://deviens.dev/metier-developpeur/\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">Le métier de développeur</a> | <a href=\\\"https://deviens.dev/metier-developpeur/cest-quoi-un-developpeur\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">C\\\'est quoi un développeur</a> | <a href=\\\"https://deviens.dev/metier-developpeur/cest-quoi-un-developpeur/\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">Les spécialisations du web</a></p><p><br></p><h2>Les mains dans le code</h2><p><br></p><p>Pour savoir si tu es fait pour devenir développeur, il n’y a pas 36 solutions : il faut commencer à coder ! Pour cela, nous avons préparé différents parcours d’initiation à arpenter pour se frotter aux langages web. HTML, CSS, PHP et bien d’autres technologies :</p><p><br></p><p><a href=\\\"https://deviens.dev/initiation\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">Initiation au code</a></p><p><br></p><h2>Veille technologique</h2><p><br></p><p>Nous avons créé une section dédiée au contenu écrit par des professionnels à destination des lecteurs qui s’intéressent au développement ou&nbsp;qui&nbsp;envisagent une reconversion au métier de développeur. C\\\'est <a href=\\\"https://deviens.dev/blog\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">le blog de Deviens.dev</a> ! Une section avec plein de conseils et tutos, des témoignages de développeurs chevronnés qui souhaitent partager leur expérience et aussi du contenu totalement inutile mais pourtant indispensable à la compréhension de ce métier.</p><p><br></p><h2>Contribution</h2><p><br></p><p><strong>DeviensDev est une plateforme d’information sur le métier de développeur.</strong></p><p>Elle repose intégralement sur un système de contribution. Ainsi, tous les professionnels du développement qui souhaitent partager leurs connaissances, leur vision et leur passion du métier sont invités avec plaisir à contribuer à la plateforme. Si tu souhaites apporter ta pierre à l’édifice DeviensDev, tu peux écrire un article qui sera publié sur le blog :&nbsp;<a href=\\\"https://deviens.dev/blog\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">Parlons Dev</a>&nbsp;! Pour ce faire, il y a quelques étapes à respecter :</p><p><br></p><p><br></p><p>TU SOUHAITES PROPOSER UN ARTICLE ?</p><p><br></p><ul><li>Fork le dépôt&nbsp;<a href=\\\"https://github.com/O-clock-Alumni/DeviensDev\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">GitHub</a></li><li>Crée une branche et positionne-toi dessus</li><li>Crée ton article dans&nbsp;content/blog/*, à l’aide du fichier&nbsp;contributing.md</li><li>Crée un fichier&nbsp;.json&nbsp;dans&nbsp;content/authors/*&nbsp;et ajoutes-y ton twitter et ta bio</li></ul><p><br></p><h3>Pour tester le rendu de ton article, en local :</h3><ul><li>yarn&nbsp;pour installer les dépendances nécessaires</li><li>yarn start&nbsp;pour lancer le site en local</li></ul><p><br></p><h3>Quand tout est OK :</h3><ul><li>On fait une relecture</li><li>On planifie la publication</li><li>On met en ligne l’article</li></ul><p><br></p><p><br></p><p>TU SOUHAITES CORRIGER UN ARTICLE&nbsp;?</p><p><br></p><p>Tu as le choix :</p><ul><li>Suivre la procédure décrite dans «&nbsp;Tu souhaites proposer un article&nbsp;»</li><li>Le faire directement depuis l’interface GitHub</li></ul><p><br></p><p>Si tu ne sais pas comment t’y prendre…</p><p>N’hésite pas à ouvrir une issue sur le dépôt GitHub, et notre équipe viendra te filer un coup de main.</p><p><br></p><p><a href=\\\"https://github.com/O-clock-Alumni/DeviensDev\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\"><strong>VOIR LE DÉPÔT</strong></a></p>', 'DeviensDev le site pour découvrir les métiers du développement', '7', 'https://i.ibb.co/5cTqSkW/download-1.jpg', 'https://i.ibb.co/5cTqSkW/download-1.jpg', 'https://github.com/O-clock-Alumni/DeviensDev', 'https://deviens.dev/', '6', '1', '7', '47', NULL, NULL, NULL, '2020-12-20 23:49:38.000', '2021-01-05 15:13:30.751'),
('10', 'Bucket - L\'application pour suivre sa Bucket List et atteindre ses objectifs', '<p>Bucket est une belle application moderne qui vous aide à suivre votre Bucket List, à planifier la résolution de votre nouvelle année et à atteindre vos objectifs.</p><p>Organisez votre liste de souhaits, atteignez vos objectifs, écrivez vos histoires, gravez vos souvenirs et partagez-les avec vos amis.</p><p><br></p><iframe class=\"ql-video\" frameborder=\"0\" allowfullscreen=\"true\" src=\"https://www.youtube.com/embed/a3KfXPT90FA?showinfo=0\"></iframe><p><br></p><p>Nous sommes ravis de partager Bucket avec la communauté!</p><p>Bucket est une application de Bucket List moderne qui vous aide à suivre votre liste, à atteindre vos objectifs et à graver vos souvenirs.</p><p><br></p><p>Nous nous efforçons de créer l\'application qui vous aide à vous concentrer sur ce qui compte vraiment pour vous personnellement et à vous offrir la meilleure expérience de suivi de votre liste.</p><p><br></p><p><img src=\"data:image/jpeg;base64,\"><img src=\"data:image/jpeg;base64,\"></p><p><br></p><h2>Catégorie</h2><p><br></p><p>Vous pouvez créer vos propres catégories avec une couleur d\'arrière-plan personnalisée, quelques exemples ci-dessous:</p><p>- Jeux</p><p>- L\'amour</p><p>- Voyager à travers le monde</p><p>- La vie</p><p>- 2021</p><p><br></p><h2>Votre Bucket List</h2><p><br></p><p>- Ajouter une bucket list à chaque catégorie avec l\'image et l\'histoire derrière</p><p>- Épinglez les bucket list à la page d\'accueil pour qu\'ils apparaissent dans le widget</p><p><br></p><h2>Statistiques</h2><p><br></p><p>- Suivez le nombre de seaux que vous avez atteints</p><p>- Affichez les informations derrière votre liste de seau.</p><p><br></p><p>Cela ne fait que commencer. D\'autres fonctionnalités seront bientôt disponibles. Nous aimerions avoir vos commentaires et je serais heureux de répondre à toutes vos questions</p>', '', '6', 'https://i.imgur.com/z84X3Cg.png', NULL, '', 'https://apps.apple.com/us/app/bucket-achieve-your-goals/id1534447271', '12', '45', NULL, NULL, NULL, NULL, NULL, '2020-12-22 08:29:42.000', '2020-12-22 13:24:46.336');
INSERT INTO `Projects` (`id`, `title`, `description`, `shortDescription`, `vote`, `image`, `shortImage`, `github_link`, `project_link`, `userId`, `tagId`, `tag2Id`, `tag3Id`, `tag4Id`, `tag5Id`, `tag6Id`, `createdAt`, `updatedAt`) VALUES
('14', 'Find my Star wars', '<h2>Qu\'est-ce que c\'est?</h2><p><br></p><p>Find my Star wars utilise <a href=\"https://swapi.dev/\" rel=\"noopener noreferrer\" target=\"_blank\"><em>Swapi</em></a><em> </em>(Swah-pee) qui est la première source de données quantifiée et accessible par programme au monde pour toutes les données de l\'univers canon de Star Wars!</p><p><br></p><p>Pour tout les grand fans, cela vous permet d\'accéder aux données de l\'univers de Star wars, rechercher les personnages, ou bien par planètes, vaisseaux etc...</p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><br></p><p><br></p><p>C\'est un bon exercice pour se confronter à Javascript, faire des appels Api, et utiliser du Css. L\'utilisation de la pagination pour afficher une grosse quantité de données est indispensable, et très intérressante à mettre en place!</p>', '', '4', 'https://i.imgur.com/cg8hsMM.png', NULL, 'https://github.com/JordanSuarez', '', '3', '1', '2', '51', NULL, NULL, NULL, '2020-12-22 09:52:10.000', '2020-12-22 13:17:29.238');
INSERT INTO `Projects` (`id`, `title`, `description`, `shortDescription`, `vote`, `image`, `shortImage`, `github_link`, `project_link`, `userId`, `tagId`, `tag2Id`, `tag3Id`, `tag4Id`, `tag5Id`, `tag6Id`, `createdAt`, `updatedAt`) VALUES
('15', 'Histoires de noël', '<p>Retrouvez toutes les belles histoires et traditions de Noël et de Saint Nicolas, celles qui ont bercé notre enfance et celles que nous avons oubliées. Les origines et l\'histoire de la crèche, l\'histoire de la bûche, l\'histoire du sapin de Noël et des boules de Noël.</p><p>&nbsp;</p>', '', '5', 'https://image.freepik.com/vecteurs-libre/page-destination-design-noel_23-2148323862.jpg', NULL, '', '', '1', '1', '7', '8', '15', '20', '23', '2020-12-22 10:17:12.000', '2020-12-22 16:25:59.000'),
('16', 'Todolist', '<p>Une TODO list est un excellent projet pour commencer à se familiariser avec l’entrée de données et son affichage. En faisant une todo list, vous apprendrez, par exemple :</p><ul><li>Comment gérer et afficher différents elements en fonction de leur état</li></ul><p><img src=\"data:image/png;base64,\"></p><ul><li>Comment créer, récupérer, modifier et supprimer des objets en javascript</li></ul><p><img src=\"data:image/png;base64,\"></p><ul><li>Comment aller plus loin avec de la permanence de data localement en explorant&nbsp;localStorage</li></ul><p><br></p><p>Une TODO liste est un projet qui sera souvent repris en exemple quand vous apprendrez des frameworks ou libraires telles que&nbsp;react,&nbsp;react-native,&nbsp;vue.js,&nbsp;angular.js&nbsp;et d’autres. Faire ce projet en JS Vanilla et HTML a donc beaucoup de sens et facilitera votre apprentissage dans le futur.</p>', '', '2', 'https://image.noelshack.com/fichiers/2020/52/2/1608643060-download-1.png', NULL, 'https://github.com/JordanSuarez', '', '3', '1', '2', NULL, NULL, NULL, NULL, '2020-12-22 10:17:29.000', '2020-12-23 17:13:14.000'),
('18', 'Cook Me', '<p>L’aventure de la création d\'une recette et du partage.</p><p>Cook me est un projet en cour de développment qui permettra à terme de créer, partager, liker des recettes...</p>', '', '5', 'https://image.noelshack.com/fichiers/2020/52/2/1608643136-download.jpeg', NULL, '', '', '3', '7', '26', '50', '17', NULL, NULL, '2020-12-22 10:31:22.000', '2020-12-22 13:20:10.742'),
('19', 'Ma belle poissonnerie ', '<p>Parce que je mange des poulpes à longueur de journée</p>', '', '4', 'https://www.delicieuxsecret.com/images/272/p/272_264697_m3.jpg', NULL, '', '', '11', '34', '23', '5', NULL, NULL, NULL, '2020-12-22 10:53:59.000', '2020-12-22 13:34:37.660'),
('20', 'A la chocolatine !', '<p><strong>Chocolatine</strong> ou pain au chocolat ? C’est l’éternel débat, et nous avons la réponse !&nbsp;</p><p>Boulangerie au cœur de Toulouse !</p><p>Pour un grand repas, pensez à commander votre pain et vos viennoiseries en&nbsp;<strong>ligne</strong>&nbsp;!</p>', '', '5', 'https://static.thiriet.com/data/common_public/gallery_images/site/18756/18774/108662,8_pains_au_chocolat_pur_beurre.jpg', NULL, '', '', '1', '26', '17', '46', '1', NULL, NULL, '2020-12-22 10:54:33.000', '2020-12-22 13:16:04.208'),
('21', 'PassionCharcut - Le site des passionnés du gras et de la charcuterie', '<h1>Le site des passionnés du gras et de la charcuterie</h1><p><br></p><p>Parce que le gras c\'est la vie, nous avons décidé de réunir tous les passionnés de charcut\' sur un même site ! Parlons peu mais parlons saucisson !</p><p><br></p><p><img src=\"data:application/octet-stream;base64,\"></p>', '', '6', 'https://i.ibb.co/wpqGdSS/le-gras-c-est-la-vie.jpg', NULL, 'https://github.com/', '', '15', '3', '6', NULL, NULL, NULL, NULL, '2020-12-22 10:59:42.000', '2021-01-14 13:36:10.000'),
('22', 'O\' blagues d\' Alban !', '<p>Retrouvez les blagues les plus drôles, marrantes d\' Alban. Tous les jours découvrez de nouvelles blagues ! Plus d\'une centaine de blagues vous attendent pour tous les goûts !</p><p><br></p>', '', '6', 'https://i.ibb.co/dPdxcgk/t-l-chargement.png', NULL, '', '', '1', '19', '7', '8', NULL, NULL, NULL, '2020-12-22 10:59:48.000', '2020-12-22 13:45:07.611'),
('24', 'Tarti-Party - La fête oui ! Mais pas sans tartiflette !', '<h1>Tarti-Party - La fête oui ! Mais pas sans tartiflette !</h1><p>jbhbb</p>', '', '6', 'https://i.ibb.co/ZBW4qKJ/t-l-chargement.jpg', NULL, 'https://github.com/', '', '5', '2', '8', NULL, NULL, NULL, NULL, '2020-12-22 11:09:05.000', '2021-01-14 13:36:08.000'),
('26', 'Graphist - Site de partage de croquis', '<p>Un site&nbsp;qui permet de créer des dessins du bout de la souris et de les partager.</p>', '', '6', 'https://i.ibb.co/njp8Y8L/graph.jpg', NULL, '', '', '17', '1', '3', '2', NULL, NULL, NULL, '2020-12-22 11:14:19.000', '2020-12-22 14:23:43.000'),
('31', 'O\'Lobby', '<p>Le matchmaking des jeux vidéos (Fortnite, COD, Apex Legends, GTA, etc.) en réseau sur les plateformes Playstation, Xbox, PC peut gâcher l\'expérience des utilisateurs de ces jeux et ils ressortent de sessions de parties déçus du comportement des autres participants (abandon en cours de jeu, incivisme, non-collaboration), regrettent la non-équivalence de niveau, sans oublier la barrière de la langue.</p><p><strong>O’Lobby</strong> est un réseau social destiné aux joueurs avec peu de relation ou cherchant une meilleure expérience de jeu en trouvant des joueurs qui correspondent à leurs critères. Le joueur pourra se constituer un carnet de profils de joueur plus rapidement qu\'en les trouvant seulement en partie et dans son entourage proche.</p>', '', '3', 'https://i.ibb.co/nBDtTfP/download-2.png', NULL, '', '', '22', '7', '26', NULL, NULL, NULL, NULL, '2020-12-22 12:44:00.000', '2020-12-22 14:23:40.000');
