('32', 'MistralCSS - TailwindCSS2.x components', '<p><img src=\"data:image/gif;base64,\"></p><p><br></p><p>Create unlimited web designs and ship your product faster ⚡ with 100+ TailwindCSS 2.x high-quality and responsive components!</p><p>Don\'t spend days on your product design, MistralCSS provides pre-made TailwindCSS blocks to kickstart all your products.&nbsp;</p><p><br></p><p>And with our built-in customization system, create unlimited variations of any component! Choose your color schema, dark/light mode, copy the code, and you\'re done. Yup, it\'s&nbsp;<strong>THAT&nbsp;</strong>easy.&nbsp;</p><p><br></p><iframe class=\"ql-video\" frameborder=\"0\" allowfullscreen=\"true\" src=\"https://www.youtube.com/embed/bv_CCbG6inw?showinfo=0\"></iframe><p><br></p>', '', '5', 'https://i.ibb.co/yFmNX5k/t-l-chargement-1.png', NULL, '', 'https://mistralcss.com', '23', '1', '12', NULL, NULL, NULL, NULL, '2020-12-22 12:50:32.000', '2020-12-25 00:49:28.000');
