('33', 'JustMandala - Give your brain a 5 minutes break, Draw stressless Mandalas.', '<p>JustMandala was #3 Product of the Day on ProductHunt.</p><p>Now available as a Vanilla JS Open Source project.</p><p><br></p><p><img src=\"data:image/gif;base64,\"></p>', '', '6', 'https://i.ibb.co/X8SD40P/download-9.png', NULL, 'https://github.com/Icesofty/Mandala-JS', 'justmandala.com', '23', '2', NULL, NULL, NULL, NULL, NULL, '2020-12-22 12:56:34.000', '2021-01-14 13:36:04.000');
