('34', 'French.dev - (re)mettre les développeurs au centre de l\'attention', '<h1>La France a&nbsp;<strong>DES</strong>&nbsp;incroyables talents&nbsp;✨</h1><p><br></p><p>Le marché de l\'emploi des développeurs est atypique, tout comme vous l\'êtes. C\'est pourquoi nous croyons qu\'il est essentiel de mettre les développeurs au centre de l\'attention:&nbsp;<strong>C\'est la raison d\'être de French.dev. </strong></p><p><br></p><p><strong>Stack EJS (❤) / VueJS / Node / Mongo </strong></p><p><br></p><p><strong><span class=\"ql-cursor\">﻿</span></strong></p><p><br></p>', '', '8', 'https://i.ibb.co/cC0q4v1/download-8.png', NULL, '', 'https://www.french.dev/', '23', '6', '8', '19', NULL, NULL, NULL, '2020-12-22 13:05:17.000', '2021-01-14 13:36:05.000');

